import './ExpenseItem.css';

export default ({date, title, amount}) => {  
  return (
    <div className='expense-item'>
      <div>{date.toISOString()}</div>
      <div className='expense-item__description'>
        <h2>{title}</h2>
        <div className='expense-item__price'>{amount} PLN</div>
      </div>
    </div>
  );
}
